:</b> $%%Sub_Total%%<br>\n\t\t\t\t<b>Tax:</b> $%%Tax%%<br>\n\t\t\t\t<b style=\"color: rgb(109, 109, 109); text-align: center;\">Total:</b><span style=\"color: rgb(109, 109, 109); text-align: center;\">&nbsp;$%%Cart_Total%%</span></td></tr><tr>\n\t\t\t<td style=\"font-family: Gotham, Helvetica, Arial, sans-serif; color: #6d6d6d; text-align: center; font-size: 16px; line-height: 22px;\">\n\t\t\t\t<center>\n\t\t\t\t\t<img class=\"photo\" src=\"https://s3-us-west-2.amazonaws.com/rd-industry-emails/retail/nto/campaign-toolkits/post-purchase/order-confirmation/branding-gray-line.png\" style=\"padding: 15px 0px;\"></center></td></tr><tr>\n\t\t\t<td style=\"font-family: Gotham, Helvetica, Arial, sans-serif; color: #8f8f8f; text-align: center; font-size: 11px; line-height: 15px; padding: 0px 25px;\">\n\t\t\t\t<span style=\"font-size: 11px; color: #0f80b3; font-weight: bold; line-height: 18px;\">Have a question about your order?</span> Our NTO experts are available 24/7 to assist you. Give us a call at 555.212.3698 or tweet your question to us @NTOutfitters.</td></tr></table></td></tr></table>",
