one; border-radius: 3px; background-color: rgb(82, 174, 244); border-width: 12px 18px; border-style: solid; border-color: rgb(82, 174, 244); display: inline-block; line-height: 16px;\" target=\"_blank\" title=\"\">Deep Dive Help Page</a></td></tr></table></td></tr></table> <!-- end content area --> %%[ set @subjectLine = Concat(\"Pre-Work is Due \",@dueDate) ENDIF IF RowCount(@submissions) > 0 THEN set @attendee = Row(@submissions, 1) IF Field(@attendee, \"Social Approved\") == \"0\" OR Field(@attendee,\"Social 2 Approved\") == \"0\" OR Field(@attendee,\"Social 3 Approved\") == \"0\" OR Field(@attendee,\"Social 4 Approved\") == \"0\" OR Field(@attendee,\"CB AB Approved\") == \"0\" OR Field(@attendee,\"DA Approved\") == \"0\" OR Field(@attendee,\"JB Approved\") == \"0\" OR Field(@attendee,\"PB Approved\") == \"0\" OR Field(@attendee,\"PB 2 Approved\") == \"0\" OR Field(@attendee,\"Mobile Approved\") == \"0\" OR Field(@attendee,\"Mobile 2 Approved\") == \"0\" THEN set @firstHalf = \"fail\" ENDIF IF Field(@attendee,\" Platform Approved\") == \"0\" OR Field(@attendee,\"MCC Approved\") == \"0\" OR Field(@attendee,\"MCC 2 Approved\") == \"0\" OR Field(@attendee,\"MCC 3 Approved\") == \"0\" OR Field(@attendee,\"MCC 4 Approved\") == \"0\" OR Field(@attendee,\"MCC 5 Approved\") == \"0\" OR Field(@attendee,\"MCC 6 Approved\") == \"0\" THEN set @secondHalf = \"fail\" ENDIF IF @secondHalf == \"fail\" OR @firstHalf == \"fail\" THEN]%% <!-- content area --><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tmp--container\" style=\"background-color:#ffffff;\" width=\"600\">\n \n  <tr>\n   <td align=\"left\" style=\"color:#4f4f4f;font-family:Arial, sans-serif;font-size:16px;font-style:normal;font-weight:normal;line-height:20px;padding:20px;text-align:center;vertical-align:top;\" width=\"100%\">\n    Thanks for submitting your Pre-Work. It looks like the Experts have a few questions about your Pre-Work. Head over to Chatter for more information on completing your pre-work.&nbsp;<br>\n    <br>\n    <!-- ============================== --><table align=\"center\" class=\"tmp--full-width\" width=\"100%\">\n     \n      <tr>\n       <td align=\"center\" style=\"padding:20px 0 10px 0;\">\n        <a alias=\"\" conversion=\"false\" data-linkto=\"https://\" href=\"%%=RedirectTo(@helpLink)=%%\" style=\"color: rgb(255, 255, 255); text-decoration-line: none; border-radius: 3px; background-color: rgb(82, 174, 244); border-width: 12px 18px; border-style: solid; border-color: rgb(82, 174, 244); display: inline-block; line-height: 16px;\" target=\"_blank\" title=\"\">Deep Dive Help Page</a></td></tr></table></td></tr></table> <!-- end content area --> %%[ set @subjectLine = \"Your Deep Dive Pre-Work May Have Errors\" ELSE ]%% <!-- content area --><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tmp--container\" style=\"background-color:#ffffff;\" width=\"600\">\n \n  <tr>\n   <td align=\"left\" style=\"color:#4f4f4f;font-family:Arial, sans-serif;font-size:16px;font-style:normal;font-weight:normal;line-height:20px;padding:20px;text-align:center;vertical-align:top;\" width=\"100%\">\n    <span style=\"color:#4f4f4f;display:inline-block;font-family:Arial, sans-serif;font-size:18px;font-style:normal;font-weight:bold;padding:5px 0 10px 0;\">Thanks for Submitting</span><br>\n    Thanks for submitting your Pre-Work. It looks like the Experts are still grading your work. We'll get back to you shortly if there are any problems. We look forward to seeing you in %%=v(@city)=%%.<br>\n    <br>\n    <!-- ============================== --><table align=\"center\" class=\"tmp--full-width\" width=\"100%\">\n     \n      <tr>\n       <td align=\"center\" style=\"padding:20px 0 10px 0;\">\n        <a alias=\"\" conversion=\"false\" data-linkto=\"https://\" href=\"%%=RedirectTo(@helpLink)=%%\" style=\"color: rgb(255, 255, 255); text-decoration-line: none; border-radius: 3px; background-color: rgb(82, 174, 244); border-